import React from 'react';
import './Movies.css';

const Movies = (props) => {
    return (
        <div className="col-12 col-sm-12 col-md-12 col-lg-12 col-xl-12 mt-3">
            <div className="row">
                {props.movies.map((movie, index) => (
                    <div className='col-12 col-sm-6 col-md-3 col-lg-4 col-xl-4 movie_image_container d-flex justify-content-start'>
                        <img src={movie.Poster} alt='movie'></img>
                    </div>
                ))}
            </div>
        </div>
    );
};

export default Movies;
